import React from 'react';
import './App.css';
import User from './containers/User.js';
import Channels from './containers/Channels.js';
import ChatWindow from "./components/ChatWindow.js";


function App() {
  return (
    <div className="app-container">
      <User />
      <Channels />
      <ChatWindow />
    </div>
  );
}

export default App;
